import React from 'react';
import ButtonsHomeView from '../../components/buttons/ButtonsHomeView';
import './HomeView.css';


function HomeView() {

  const redirectBuscoEquipo = (props) => {
    window.location.href = '/busco-equipo';
  }

  return (
    <div className='backgroundImage'>
      <div className='Text'>
        <div className='Title'>
          <h1>
            TeamUp
          </h1>
        </div>
        <div className='subtitle'>
          <h3>
            Are you ready for this new experience?
          </h3>
        </div>
        <div className='ContainerButtons'>
          <ButtonsHomeView name='Busco equipo' onClick={redirectTo('busco-equipo')}/>
          <ButtonsHomeView name='Arriendo mi Cancha' onClick={redirectTo('arriendo-mi-cancha')} />
        </div>
      </div>
    </div>
  )
}

export default HomeView;
